import React from 'react';
import { Container, Card } from 'react-bootstrap';

const Home = () => {
  return (
    <Container>
      <Card className="text-center mt-4">
        <Card.Body>
          <Card.Title as="h1">Welcome to Baruch College Club Management System</Card.Title>
          <Card.Text>
            This system allows you to manage students, clubs, and events at Baruch College.
            Use the navigation bar above to access different sections of the application.
          </Card.Text>
        </Card.Body>
      </Card>
    </Container>
  );
};

export default Home;
